import { useCallback } from 'react';
import './SoundItemForm.css'

const SoundItemForm = () => {
    const handleSubmit = useCallback((event) => {
        event.preventDefault();
        console.log('Submit');
    }, []);
    return (
        <form onSubmit={handleSubmit}>
            <label htmlFor="state">State</label>

        </form>
    );
}

export default SoundItemForm;
